import React from "react";
import { useParams } from "react-router-dom";
import products from "../designs";
import '../CSS/detail.css';
const Detail = () => {
    const {Id} = useParams();
    const {name} = useParams();
    let index = products.findIndex(x=>x.Id === Id)
    return (
        <>
            <section className="detail-section">
                <div className="main-container">
                    <div className="productDetail">
                        <div className="col col-1">
                            <img src={"/" + products[index].image} ></img>
                        </div>
                        <div className="col col-2">
                            <div className="saveBtn">
                                <div className="buttons">
                                    <a>Save</a>
                                </div>
                            </div>
                            <div className="heading">
                                <h2>{products[index].name}</h2>
                            </div>
                            <div className="para">
                                <p>Luxury Minimal Modern Save The Date What's included: A6 save the date card A6 return envelope Materials: 300gsm 100% recycled card Card tab with date Wax seal stamp This item comes in various colours, this is the pink and white option for other colour options visit our store</p>
                            </div>
                            <div className="link">

                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}
export default Detail;
